import axios from "axios";

const Credentials = {
  email: `tony@stark.com`,
  password: `password123`,
};

export const GET_PROFILE = "GET_PROFILE";

export const getProfile = () => {
  return (dispatch) => {
    return axios
      .post("http://localhost:3001/api/v1/user/login", Credentials)

      .then((res) => {
        console.log(res);
      });
  };
};
